using iTextSharp.text;
using iTextSharp.text.html;
using iTextSharp.text.pdf;
using System;
using System.Collections.Generic;
using System.Drawing;
using System.Globalization;
using System.IO;
using System.Linq;
using System.Threading;
using WebAppRfc.Dto;
using WebAppRfc.helper;

namespace WebAppRfc.Utils
{
    public static class DocumentoPdf
    {
        public static MemoryStream generarPdf(PersonaDto personaDto)
        {
            string base64 = "";
            var ms = new MemoryStream();
            Paragraph paragEnc = null;

            var document = new Document(PageSize.A4, 30, 30, 30, 30);

            iTextSharp.text.Font fontTitleParagraph = FontFactory.GetFont("Arial", 9, iTextSharp.text.Font.BOLD, BaseColor.BLACK);
            iTextSharp.text.Font fontTextParagraph = FontFactory.GetFont("Arial", 9, iTextSharp.text.Font.NORMAL, BaseColor.BLACK);
            iTextSharp.text.Font fontTitleTable = FontFactory.GetFont("Arial", 9, iTextSharp.text.Font.BOLD, BaseColor.BLACK);
            iTextSharp.text.Font fontTextTable = FontFactory.GetFont("Arial", 9, iTextSharp.text.Font.NORMAL, BaseColor.BLACK);

            var writer = PdfWriter.GetInstance(document, ms);
            writer.PageEvent = new PDFFooter(personaDto);


            document.Open();

            Paragraph paragBlank = new Paragraph(" ");


            document.Add(paragBlank);

            //logo 4
            base64 = @"";
            iTextSharp.text.Image image = iTextSharp.text.Image.GetInstance(Convert.FromBase64String(base64));

            image.ScaleAbsolute(60f, 20f);



            PdfPTable table = new PdfPTable(1);
            table.WidthPercentage = 100;

            PdfPCell cell = new PdfPCell();
            paragEnc = new Paragraph("  gob.mmx", FontFactory.GetFont("Arial", 9, iTextSharp.text.Font.BOLD, BaseColor.WHITE));
            cell.AddElement(paragEnc);
            cell.AddElement(paragBlank);
            //cell.HorizontalAlignment = PdfPCell.ALIGN_LEFT; //Tried with Element.Align_Center Also. Tried Adding this line before adding element also. 
            //cell.VerticalAlignment = PdfPCell.ALIGN_LEFT;           
            cell.BackgroundColor = new BaseColor(System.Drawing.Color.Black);
            table.AddCell(cell);

            document.Add(table);


            document.Add(paragBlank);

            table = new PdfPTable(2);
            table.WidthPercentage = 100;

            cell = new PdfPCell();
            cell.Rowspan = 3;
            cell.HorizontalAlignment = PdfPCell.ALIGN_CENTER; //Tried with Element.Align_Center Also. Tried Adding this line before adding element also. 
            cell.VerticalAlignment = PdfPCell.ALIGN_MIDDLE;
            //logo 2
            base64 = @"";
            image = iTextSharp.text.Image.GetInstance(Convert.FromBase64String(base64));

            image.WidthPercentage = 50;
            image.Alignment = Element.ALIGN_LEFT;//here is the change
            cell.AddElement(image);
            cell.Border = 0;
            table.AddCell(cell);

            cell = new PdfPCell();
            cell.Rowspan = 3;
            cell.HorizontalAlignment = PdfPCell.ALIGN_CENTER; //Tried with Element.Align_Center Also. Tried Adding this line before adding element also. 
            cell.VerticalAlignment = PdfPCell.ALIGN_MIDDLE;
            //logo 3
            base64 = @"";
            image = iTextSharp.text.Image.GetInstance(Convert.FromBase64String(base64));
            image.WidthPercentage = 50;
            image.Alignment = Element.ALIGN_RIGHT;//here is the change
            cell.AddElement(image);
            cell.Border = 0;
            table.AddCell(cell);

            document.Add(table);
            document.Add(paragBlank);


            table = new PdfPTable(1);
            table.WidthPercentage = 100;
            cell = new PdfPCell();
            Paragraph paragEnc00 = new Paragraph("COMUNICADO", fontTitleParagraph);
            paragEnc00.Alignment = Element.ALIGN_CENTER;//here is the change
            cell.AddElement(paragEnc00);
            cell.BackgroundColor = WebColors.GetRGBColor("#f1f1f1");
            cell.Border = 0;
            table.AddCell(cell);
            document.Add(table);

            document.Add(paragBlank);
            document.Add(paragBlank);

            table = new PdfPTable(1);
            table.WidthPercentage = 100;
            cell = new PdfPCell();
            cell.BackgroundColor = iTextSharp.text.BaseColor.GRAY;
            Chunk underline = new Chunk("Lugar y Fecha de Emisión", fontTitleParagraph);
            paragEnc = new Paragraph(underline);
            paragEnc.Alignment = Element.ALIGN_CENTER;//here is the change
            cell.AddElement(paragEnc);
            cell.BackgroundColor = WebColors.GetRGBColor("#f1f1f1");
            cell.Border = 0;
            table.AddCell(cell);

            DateTime fechaActual = DateTime.Parse(DateTime.Now.ToString());
            Thread.CurrentThread.CurrentCulture = new CultureInfo("es-ES");

            cell = new PdfPCell();
            cell.BackgroundColor = WebColors.GetRGBColor("#f1f1f1");
            underline = new Chunk($"CHIHUAHUA, JUAREZ, A {fechaActual.ToString("dd MMMM yyyy").ToUpper()}", fontTitleParagraph);
            paragEnc = new Paragraph(underline);
            paragEnc.Alignment = Element.ALIGN_CENTER;//here is the change
            cell.AddElement(paragEnc);
            cell.Border = 0;
            table.AddCell(cell);

            document.Add(table);

            document.Add(paragBlank);

            String paragEncText = $"Estimado Contribuyente: {personaDto.Apellido1.ToUpper()}, {personaDto.Apellido2.ToUpper()}, {personaDto.Nombre.ToUpper()}, le informamos que su " +
                $"Clave Única de Registro de Población {personaDto.Curp.ToUpper()} ya se encuentra en el Padrón del Registro Federal de Contribuyentes " +
                $"con la clave de RFC: {personaDto.Rtc.ToUpper()}.";
            paragEnc = new Paragraph(paragEncText, fontTextParagraph);
            paragEnc.Alignment = Element.ALIGN_JUSTIFIED;
            document.Add(paragEnc);

            document.Add(paragBlank);
            paragEncText = $"Sus datos personales son incorporados y protegidos en los sistemas del SAT, de conformidad con los" +
                $" Lineamientos de Protección de Datos Personales y con diversas disposiciones fiscales y legales sobre confidencialidad y" +
                $" protección de datos, a fin de ejercer las facultades conferidas a la autoridad fiscal.";
            paragEnc = new Paragraph(paragEncText, fontTextParagraph);
            paragEnc.Alignment = Element.ALIGN_JUSTIFIED;
            document.Add(paragEnc);

            document.Add(paragBlank);

            paragEncText = $"Si desea modificar o corregir sus datos personales, puede acudir a cualquier Módulo de Servicios " +
                $"Tributarios y/o a través de la dirección http://sat.gob.mx";
            paragEnc = new Paragraph(paragEncText, fontTextParagraph);
            paragEnc.Alignment = Element.ALIGN_JUSTIFIED;
            document.Add(paragEnc);


            document.Add(paragBlank);
            document.Add(paragBlank);

            PdfPCell varEstadoImagen = new PdfPCell();
            varEstadoImagen.HorizontalAlignment = Element.ALIGN_RIGHT;
            varEstadoImagen.VerticalAlignment = Element.ALIGN_MIDDLE;
            varEstadoImagen.UseAscender = true;

            document.Close();

            byte[] file = ms.ToArray();
            MemoryStream output = new MemoryStream();
            output.Write(file, 0, file.Length);
            output.Position = 0;

            return output;

            //// Return the output stream
            //return new FileStreamResult(output, "application/pdf");
        }
    }
}